function hex8ToRgba(bgColor) {
  var color = bgColor.slice(1);
  var rgba = [
    parseInt('0x' + color.slice(0, 2)),
    parseInt('0x' + color.slice(2, 4)),
    parseInt('0x' + color.slice(4, 6)),
    parseInt('0x' + color.slice(6, 8))
  ];
  return 'rgba(' + rgba.toString() + ')';
}
